export class Agenda {
    id: string;
    nome: string;
    telefone: string;
    email: string;
    empresa: string;

    constructor(id:string, nome:string, telefone:string, email:string, empresa:string) {
        this.id = id;
        this.nome = nome;
        this.telefone = telefone;
        this.email = email;
        this.empresa = empresa;
    }
}
